pragma solidity ^0.4.23;

import "./Contributions.sol";
import "../ownership/Ownable.sol";

contract ContributorsWhitelist is Ownable {
    using Contributions for Contributions.Contribution;

    Contributions.Contribution VCContributors;
    Contributions.Contribution DeveloperContributors;

    function addToVC(address _address) public onlyOwner {
        VCContributors.add(_address);
    }

    function addToDevelopers(address _address) public onlyOwner {
        DeveloperContributors.add(_address);
    }

    function removeFromVC(address _address) public onlyOwner {
        VCContributors.remove(_address);
    }

    function removeFromDevelopers(address _address) public onlyOwner {
        DeveloperContributors.remove(_address);
    }

    function checkVC(address _address) public view returns (bool){
        VCContributors.check(_address);
    }

    function checkDeveloper(address _address) public view returns (bool) {
        DeveloperContributors.check(_address);
    }

    modifier onlyVC(address _address) {
        require(checkVC(_address));
        _;
    }

    modifier onlyDeveloper(address _address) {
        require(checkDeveloper(_address));
        _;
    }

}
